/* Khon characters */= Khon characters ==
A khon story has many characters. The most famous characters in the story are the monkey warriors, Hanuman and Phra Ram.

Modern khon contains many elements from the ''[[Ream ke]]'' and today, includes female performers playing female characters, formerly performed by men.<ref name="Brandon-1967">{{cite book|last1=Brandon|first1=James R|title=Theatre in Southeast Asia|date=1967|publisher=Harvard University Press|isbn=0674875877|url=https://books.googl...
